Twice Kissed | Juliette March | Ruby Reaper
June 6, 2012 

Mp4 + Pics.

Juliette March and Elise Graves are going to play some games but that is really just an opening act. Juliette is tied to the rafters to keep her standing on point. If she relaxes her stance she gets to feel the ropes around her neck resisting her descent. 

The main event? That is PD and Ruby Reaper. She is strapped down to the bare bones frame of his favorite bed. He wastes no time getting down to the business of making her scream. It does not take much to get a good screech. A flog, a fuck or the cold steel of an ass hook are all there to put her into her place.  
